const theme = {
    colors: {
      background: 'radial-gradient(circle at 100%, #87CEFA, #87CEFA 50%, #eee 75%, #87CEFA 75%)',
      black: '#282c34',
      blue: '#a0e9fd',
      lightBlue: '#caf3fe',
      white: 'white',
    },
    transition: '0.01s',
  }

export default theme;
